INSERT INTO `tbl_page` VALUES (1,'About Us','<h3 style=\"text-align: center; margin-top: 0px; margin-bottom: 33px; line-height: var(--page-title-line-height);\"><div style=\"text-align: justify;\"><font color=\"#858585\" face=\"Poppins, sans-serif\"><span style=\"font-size: 15px;\">For over 15 years, we have been providing a comprehensive maintenance service for companiesâ€™ office and industrial facilities. Deep Cleaning Services offers flexible maintenance solutions that can be adapted to the specific needs of each client. We take our clientsâ€™ objectives into account, adhere to them, and reflect them in our contracts. In order to provide the best service, Deep Cleaning Service professionals train on an ongoing basis. They all have proven experience in the integral maintenance of buildings and industrial facilities. Continuous improvement and every new contract allow us to offer innovative solutions as a result of our understanding of the service. We work 24/7 anywhere in Florida.</span></font></div><div style=\"text-align: justify;\"><font color=\"#858585\" face=\"Poppins, sans-serif\"><span style=\"font-size: 15px;\"><br></span></font></div><div style=\"text-align: justify;\"><font color=\"#858585\" face=\"Poppins, sans-serif\"><span style=\"font-size: 15px;\">For areas such as buildings, offices, retail stores, and shopping centers, each with unique cleaning requirements, Deep Cleaning Services offers a methodology derived from more than 15 yearsâ€™ experience where organizational and technique improvements have built the motivation of our staff, thus increasing productivity and optimizing costs. Deep Cleaning Services offers highly specialized, professional assistance to businesses all over the State of Florida, regardless of their size or field of work.</span></font></div><div style=\"text-align: justify;\"><font color=\"#858585\" face=\"Poppins, sans-serif\"><span style=\"font-size: 15px;\"><br></span></font></div><div style=\"text-align: justify;\"><font color=\"#858585\" face=\"Poppins, sans-serif\"><span style=\"font-size: 15px;\">Teamwork Systems. Procedures for assigning both individual and collective responsibilities as experienced in multiple successful venues. Mechanization. Progressive service improvement that streamlines processes and dignifies work. Specialized Cleaning Equipment. This increases productivity and prevents worker contact with surfaces to be cleaned (wet sweep with double bucket, 3-color method, cleaning by means of microfibers, disinfection by vacuuming and steaming every surface with special equipment to eliminate dirt, thus prolonging the effect of the disinfection, etc.) Microfiber mops with built-in water tanks. They increase productivity by reducing unnecessary displacements, improving process ergonomics, avoiding forced postures, etc.</span><br></font></div><div style=\"text-align: justify;\"><br></div></h3><h3 style=\"margin-top: 10px; margin-bottom: 0px; line-height: 1.2;\"><div class=\"rte mb-50 mb-lg-60\" style=\"line-height: var(--body-lg-line-height); margin-bottom: 60px !important;\"><p></p></div></h3>','about-banner.jpg','https://suppliesdcs.com - About Us','about, about us, about cleaning, about company, about techniques','We specialize in professional cleaning techniques, which allows us to offer you the best alternative\r\nfor the care and protection of your companys facilities.','FAQ','faq-banner.png','https://suppliesdcs.com - FAQ','','','Blog','blog-banner.jpg','Ecommerce - Blog','','','Contact Us','contact-banner.png','https://suppliesdcs.com - Contact','','','Photo Gallery','pgallery-banner.jpg','Ecommerce - Photo Gallery','','','Video Gallery','vgallery-banner.jpg','Ecommerce - Video Gallery','','');
